import React from 'react';
import './Sidebar.css';
import { NavLink } from 'react-router-dom';
import logo from './logo.png';
import menuIcon from './menuIcon.jpg';
import homeIcon from './homeIcon.png';

function Sidebar() {
  return (
    <div className="Sidebar">
      <img alt="logo" className='Sidebar_image' src={logo}/>
      <div className='Sidebar_menu1'>
        <img alt="menuIcon" src={menuIcon}/>
        <p>ΜΕΝΟΥ ΕΠΙΛΟΓΩΝ</p>
      </div>
      <ul className="Sidebar__navigation-list">
                <li className = {"sidebar__navigation-list-item " + this.getActiveClass(this.props.link00)}>
                  <NavLink activeClassName = 'is-active' to='/home'>
                    <img alt="homeIcon" src={homeIcon}/>
                    <div> Κεντρική σελίδα </div>
                  </NavLink>
                </li>
      </ul>
    </div>
  );
}

export default Sidebar;
